import React from 'react';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import {Link} from 'react-router-dom';


const StyledTableCell = withStyles((theme) => ({
    head: {
      backgroundColor: theme.palette.common.black,
      color: theme.palette.common.white,
    },
    body: {
      fontSize: 14,
    },
  }))(TableCell);
  
  const StyledTableRow = withStyles((theme) => ({
    root: {
      '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.action.hover,
      },
    },
  }))(TableRow);
  
  function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }
  
  const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
  ];
  
  const useStyles = makeStyles({
    table: {
      minWidth: 700,
    },
  });

  
  

  function TablePokemon(props) {
    
    const classes = useStyles();
   
      return (
        

    
          <TableContainer component={Paper}>
            <Table className={classes.table} aria-label="customized table">
              <TableBody>

                  <StyledTableRow>
                    <StyledTableCell align="left">{props.champs1}</StyledTableCell>
                    <StyledTableCell align="left">{props.couleur}</StyledTableCell>
                  </StyledTableRow>

                
                  <StyledTableRow>
                    <StyledTableCell align="left">{props.champs1}</StyledTableCell>
                    <StyledTableCell align="left">{props.couleur}</StyledTableCell>
                  </StyledTableRow>

                  <StyledTableRow>
                    <StyledTableCell align="left">{props.champs2}</StyledTableCell>
                    <StyledTableCell align="left">{props.espece}</StyledTableCell>
                  </StyledTableRow>

                  <StyledTableRow>
                    <StyledTableCell align="left">{props.champs3}</StyledTableCell>
                    <StyledTableCell align="left">{props.type}</StyledTableCell>
                  </StyledTableRow>

                  <StyledTableRow>
                    <StyledTableCell align="left">{props.champs4}</StyledTableCell>
                    <StyledTableCell align="left">{props.type2}</StyledTableCell>
                  </StyledTableRow>


                  <StyledTableRow>
                    <StyledTableCell align="left">{props.champs5}</StyledTableCell>
                    <StyledTableCell align="left">{props.taille}</StyledTableCell>
                  </StyledTableRow>

                  <StyledTableRow>
                    <StyledTableCell align="left">{props.champs6}</StyledTableCell>
                    <StyledTableCell align="left">{props.poids}</StyledTableCell>
                  </StyledTableRow>

                  <StyledTableRow>
                    <StyledTableCell align="left">{props.champs7}</StyledTableCell>
                    <StyledTableCell align="left">{props.forme}</StyledTableCell>
                  </StyledTableRow>
             
              </TableBody>
            </Table>
          </TableContainer>
      
      )
  }
  
  export default TablePokemon
